import React from "react";
/** @jsx jsx */
import { css, jsx } from "@emotion/core";

import Project from "./Project";

export default class ProjectGallery extends React.Component {
  render() {
    return (
      <div
        css={css`
          display: flex;
          width: 100%;
          overflow-x: scroll;
        `}
      >
        <Project
          name="dailybruin.com"
          image={
            "data:image/jpeg;base64,"
          }
        ></Project>
        <Project></Project>
        <Project></Project>
      </div>
    );
  }
}
